ting.dataset.definition.SqlDataSetDefinition\" id=\"11\" uuid=\"dc2b093b-531a-484a-aa6e-b185f61215cb\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>enddate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>startdate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location_id</string>\n            <string>${location}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>',NOW(),2,NULL,NULL,0,NULL,NULL,NULL,'77f28238-0e5d-49b0-828c-e05f35a4ec23');
